import React, { Component } from "react";
import { Map, GoogleApiWrapper, Marker } from "google-maps-react";

class MapContainer extends Component {
  state = {};
  render() {
    const mapStyles = {
      width: "100%",
      height: "100%"
    };

    const accident = {
      lat: this.props.accident.lat,
      lng: this.props.accident.lng
    };

    const ambulances = this.props.ambulances.map(ambulance => {
      return {
        id: ambulance.id,
        lat: ambulance.lat,
        lng: ambulance.lng
      };
    });

    console.log("Accident: ", accident);
    console.log("Ambulances: ", ambulances);

    const displayMarkers = () => {
      return ambulances.map(ambulance => {
        return (
          <Marker
            key={ambulance.id}
            id={ambulance.id}
            position={{
              lat: ambulance.latitude,
              lng: ambulance.longitude
            }}
            onClick={() =>
              console.log(`You have clicked ambulance no. ${ambulance.id}`)
            }
          />
        );
      });
    };

    return (
      //   <div>Hello</div>
      <Map
        google={this.props.google}
        zoom={8}
        style={mapStyles}
        initialCenter={{ lat: accident.lat, lng: accident.lng }}>
        {displayMarkers()}
      </Map>
    );
  }
}

// export default MapContainer;

export default GoogleApiWrapper({
  apiKey: "AIzaSyCE9NRqdC2ZRtLK42pUyEMW7flJJhXouIU"
})(MapContainer);
